INSERT INTO `landings` VALUES (1,'complex','https://complex.one-team.pro/',3,'2023-08-27 23:53:04','2023-10-27 06:55:43','8 800 700 55 55','ЖК SKY BLUE','<p>Жилой комплекс класса бизнес на берегу моря в новом районе Алтынташ. Это первый район в Анталии с утвержденным проектом планировки территории</p>','uploads/landing_84724362.jpg','[{\"id\": \"0\", \"title\": \"2024\", \"content\": \"I квартал сдача жилого комплекса\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Всего квартир в комплексе\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"2\", \"content\": \"Больших бассейна на территории ЖК\"}]',NULL,'PERGE COLLECTION: SKY BLUE','БИЗНЕС-КЛАСС НА БЕРЕГУ СРЕДИЗЕМНОГО МОРЯ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1408793994.png\", \"title\": \"Большая закрытая территория с двумя бассейнами\", \"content\": \"<p>5700м2 - идеальная территория для 50 квартир, чтобы чувствовать уединенность и приватность. На территории есть сауна и тренажерный зал. Разноуровневые посадки растений по всей территории по индивидуальному проекту. Спортивная площадка для баскетбола, волейбола или тенниса.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_1793062718.png\", \"title\": \"Большая закрытая территория с двумя бассейнами\", \"content\": \"<p>5700м2 - идеальная территория для 50 квартир, чтобы чувствовать уединенность и приватность. На территории есть сауна и тренажерный зал. Разноуровневые посадки растений по всей территории по индивидуальному проекту. Спортивная площадка для баскетбола, волейбола или тенниса.</p>\"}]','[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]','uploads/landing_406444150.png','ВНЖ','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&amp;source=constructor&amp;scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>',NULL,NULL,'PERGE COLLECTION','Анталья, Турция',15,NULL),(7,'country','https://country.one-team.pro/',2,'2023-10-20 10:30:25','2023-10-20 10:30:25','8 800 700 55 55','ТУРЦИЯ','<p>Регион, в котором море, солнце, история и природа соединяются в гармонии. Древние города, море, солнце, пляж, лес - компоненты одного прекрасного целого. Мустафа Кемаль Ататюрк описывает Анталью фразой: &laquo;Несомненно, Анталья - самое красивое место в мире&raquo;.</p>','uploads/landing_459739980.jpg','[{\"id\": \"0\", \"title\": \"310\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Комплексов в продаже\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"15\", \"content\": \"Инвестиционный процент\"}]','НОВОСТРОЙКИ В ТУРЦИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\"><li>Возможна удалённая сделка</li><li>Помощь по вариантам оплаты</li></ul>\"}]',NULL,'Вид на жительство в Турции','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&source=constructor&scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ ТУРЦИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1531113488.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>Анталья &ndash; курортный город, который славится своей Старой гаванью, где швартуются яхты, и пляжами, окруженными огромными отелями.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_818982039.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>В Анталье расположены десятки исторических памятников культуры, которые непременно стоит увидеть! На протяжении всей своей истории Анталья становилась домом для десятка цивилизаций, сохранила следы этих цивилизаций и сегодня выставляет их для своих посетителей</p>\"}]',NULL,NULL,17,NULL),(8,'region','https://region.one-team.pro/',1,'2023-10-20 10:37:30','2023-10-20 10:37:30','8 800 700 55 55','АНТАЛИЯ','<p>Регион, в котором море, солнце, история и природа соединяются в гармонии. Древние города, море, солнце, пляж, лес - компоненты одного прекрасного целого. Мустафа Кемаль Ататюрк описывает Анталью фразой: &laquo;Несомненно, Анталья - самое красивое место в мире&raquo;.</p>','uploads/landing_2086620209.jpg','[{\"id\": \"0\", \"title\": \"310\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Комплексов в продаже\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"15\", \"content\": \"Инвестиционный процент\"}]','НОВОСТРОЙКИ В АНТАЛИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\"><li>Возможна удалённая сделка</li><li>Помощь по вариантам оплаты</li></ul>\"}]',NULL,'Вид на жительство в Анталии','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&source=constructor&scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ АНТАЛИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_274827534.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>Анталья &ndash; курортный город, который славится своей Старой гаванью, где швартуются яхты, и пляжами, окруженными огромными отелями.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_350227984.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>В Анталье расположены десятки исторических памятников культуры, которые непременно стоит увидеть! На протяжении всей своей истории Анталья становилась домом для десятка цивилизаций, сохранила следы этих цивилизаций и сегодня выставляет их для своих посетителей</p>\"}]',NULL,NULL,30,NULL),(11,'alanya','https://alanya.one-team.pro/',1,'2023-11-16 07:22:04','2023-11-22 10:07:01','8 800 700 55 55','Аланья','<div class=\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\">\r\n<div class=\"min-h-[20px] text-message peer flex flex-col items-start gap-3 whitespace-pre-wrap break-words peer-[.text-message]:mt-5 overflow-x-auto\" data-message-author-role=\"assistant\" data-message-id=\"11889925-ff3c-4431-b195-5f5c434efe01\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p><strong>Аланья</strong> &mdash; жемчужина Средиземноморья, где встречаются золотистые пляжи, древняя крепость и культурные фестивали. Отдыхайте на побережье, исследуйте старый город и наслаждайтесь активным отдыхом в горах. Местная кухня удивит вас разнообразием вкусов. От природы до истории, Аланья &mdash; идеальное сочетание для приобретения недвижимости.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"flex justify-between empty:hidden gizmo:mt-1 gizmo:justify-start gizmo:gap-3 lg:block gizmo:lg:flex\">\r\n<div class=\"text-gray-400 flex self-end lg:self-center justify-center gizmo:lg:justify-start mt-2 gizmo:mt-0 visible gap-1\">&nbsp;</div>\r\n</div>','uploads/landing_1906444652.jpg','[{\"id\": \"0\", \"title\": \"300\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"100 км\", \"content\": \"Длина пляжей более\"}, {\"id\": \"2\", \"title\": \"8.5\", \"content\": \"показатель качества жизни\"}, {\"id\": \"3\", \"title\": \"10\", \"content\": \"Комплексов в продаже\"}]','НОВОСТРОЙКИ В  АЛАНЬИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]',NULL,'Вид на жительство в Аланье','<p>Покупая квартиру в Аланье вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3A736426aba0cddff982f5d47847f9e72620d78d3d72c1bd802cafbc0048180aaa&amp;source=constructor\" width=\"731\" height=\"514\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ  АЛАНИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1007814332.jpg\", \"title\": \"Башня Кызылкуле\", \"content\": \"<p>Башня Кызылкуле в Аланье, Турция &mdash; символ старого города, возвышающийся над Средиземным морем. Построенная в XIII веке, она впечатляет своей архитектурой и историческим наследием. Своим названием \\\"Кызылкуле\\\" (что переводится как \\\"Красная башня\\\") она обязана красно-бурой глине, использованной для ее строительства. Посетители могут подняться на вершину башни и насладиться великолепным видом на город и море, а также узнать интересные факты о прошлом этого впечатляющего сооружения.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_774006066.jpg\", \"title\": \"Крепость Аланьи\", \"content\": \"<div class=\\\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\\\">\\r\\n<div class=\\\"min-h-[20px] text-message peer flex flex-col items-start gap-3 whitespace-pre-wrap break-words peer-[.text-message]:mt-5 overflow-x-auto\\\" data-message-author-role=\\\"assistant\\\" data-message-id=\\\"6d83d0bf-ef7d-452d-b509-8b7082c7a2a1\\\">\\r\\n<div class=\\\"markdown prose w-full break-words dark:prose-invert light\\\">\\r\\n<p>Крепость Аланьи &mdash; историческая жемчужина на турецком побережье Средиземного моря. Возвышаясь на скале, эта древняя крепость, основанная в XIII веке, представляет собой величественное сочетание стен, башен и внутренних дворцовых сооружений. С момента своего создания крепость играла ключевую роль в защите региона, а сегодня привлекает туристов своей архитектурной красотой и захватывающими видами на Средиземное море. Посетители могут прогуляться по старинным улочкам, изучить археологические находки и насладиться атмосферой старинного военного великолепия.</p>\\r\\n</div>\\r\\n</div>\\r\\n</div>\"}, {\"id\": \"2\", \"photo\": \"uploads/landing_894321455.jpg\", \"title\": \"Пещера Дамлаташ\", \"content\": \"<p>Пещера Дамлаташ &mdash; волшебный мир, скрытый в скалах Анталии. С ее удивительными сталактитами и сталагмитами, пещера привлекает туристов своей древней и таинственной аурой. Легенды и природная красота сливаются в этом удивительном подземном уголке, предлагая незабываемые впечатления.</p>\"}, {\"id\": \"3\", \"photo\": \"uploads/landing_675863110.jpg\", \"title\": \"Маяк Алании - символ света и навигации\", \"content\": \"<p>Маяк Алании &mdash; величественный страж, украшающий берега Средиземного моря. Его могучий свет манит моряков и путешественников, подчеркивая красоту этого удивительного курорта. Став символом света и безопасности, маяк Алании вписывается в историю и природную гармонию этого удивительного уголка Турции.</p>\"}, {\"id\": \"4\", \"photo\": \"uploads/landing_569507271.jpg\", \"title\": \"Луна-Парк в Аланье - веселье и развлечения у моря\", \"content\": \"<p>Луна-Парк в Аланье &mdash; это волшебное место, где встречаются азарт и веселье. Радужные аттракционы, шумные атмосфера и аромат попкорна создают неповторимую атмосферу веселья для семей, туристов и всех, кто ищет развлечения у берегов Средиземного моря.</p>\"}, {\"id\": \"5\", \"photo\": \"uploads/landing_1123683629.jpg\", \"title\": \"Дим-Чай\", \"content\": \"<p>Река в Турции. Исток реки находится в иле Конья в горах Западного Тавра на высоте 1790 м над уровнем моря. Впадает река в Средиземное море на юго-восточной окраине города Аланья (ил Анталья). Общая протяжённость реки Дим-Чай около 60 км. В 2004 году на реке Дим-Чай была открыта плотина Дим. Вода из водохранилища является главным источником пресной воды для города Аланья. Электростанция плотины Дим является главным источником энергоснабжения района Аланьи. В своём нижнем течении (ниже плотины Дим) река Дим-Чай является популярным местом отдыха жителей Аланьи и приезжих туристов. Прямо над руслом реки построено множество ресторанчиков и мест водных развлечений.</p>\"}, {\"id\": \"6\", \"photo\": \"uploads/landing_1708879927.jpg\", \"title\": \"Крепость Кызылджашехир в Аланье -  средневековое великолепие\", \"content\": \"<p>Крепость Кызылджашехир &mdash; исторический жемчужина Алании, воплощающая величие средневековой архитектуры. Своим красивым каменным обликом, она рассказывает историю прошлого, приглашая посетителей на увлекательное путешествие во времени, где каждый камень несет следы древности и воинственной истории.</p>\"}, {\"id\": \"7\", \"photo\": \"uploads/landing_1058589108.jpg\", \"title\": \"Археологический музей в Аланье: сокровищница древности\", \"content\": \"<p>Археологический Музей в Аланье &mdash; удивительное пространство, где древние артефакты оживают. Великолепные экспозиции, включающие античные сокровища и археологические находки, погружают посетителей в историю и культуру Алании. Музей становится мостом между современностью и древностью, раскрывая удивительные тайны этого замечательного региона.</p>\"}]',NULL,NULL,33,NULL),(12,'turkey','https://turkey.one-team.pro/',2,'2023-11-21 09:44:06','2023-11-21 11:05:20','8 800 700 55 55','Турция','<div class=\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start gap-3 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto\" data-message-author-role=\"assistant\" data-message-id=\"d0d4dba5-a315-4871-97e9-f4b0c31c0aa1\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Инвестиции в Турцию: Приобретение недвижимости на Средиземноморье. Стабильная экономика, разнообразие жилья &mdash; от пляжных апартаментов до горных вилл. Удобные процедуры покупки для иностранцев, культурное наследие и бурно развивающийся туризм делают Турцию идеальным регионом для успешных инвестиций в недвижимость.</p>\r\n</div>\r\n</div>\r\n</div>','uploads/landing_1488908322.jpg','[{\"id\": \"0\", \"title\": \"8000 км\", \"content\": \"Береговая линия\"}, {\"id\": \"1\", \"title\": \"500+\", \"content\": \"Традиционных блюд\"}, {\"id\": \"2\", \"title\": \"80+ млн\", \"content\": \"Туристов в год\"}, {\"id\": \"3\", \"title\": \"300+\", \"content\": \"Солнечных дней в год\"}]','НОВОСТРОЙКИ В ТУРЦИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]',NULL,NULL,'<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3A6d647262e9f09a2d9d99bcf2e4205ca6980ac57d941f9629fc6ca8e8577df8f8&amp;source=constructor\" width=\"1280\" height=\"661\" frameborder=\"0\"></iframe>','Курорты Турции','[{\"id\": \"0\", \"photo\": \"uploads/landing_398975754.jpg\", \"title\": \"Аланья\", \"content\": \"<div class=\\\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\\\">\\r\\n<div class=\\\"min-h-[20px] text-message peer flex flex-col items-start gap-3 whitespace-pre-wrap break-words peer-[.text-message]:mt-5 overflow-x-auto\\\" data-message-author-role=\\\"assistant\\\" data-message-id=\\\"11889925-ff3c-4431-b195-5f5c434efe01\\\">\\r\\n<div class=\\\"markdown prose w-full break-words dark:prose-invert light\\\">\\r\\n<p><strong>Аланья</strong> &mdash; жемчужина Средиземноморья, где встречаются золотистые пляжи, древняя крепость и культурные фестивали. Отдыхайте на побережье, исследуйте старый город и наслаждайтесь активным отдыхом в горах. Местная кухня удивит вас разнообразием вкусов. От природы до истории, Аланья &mdash; идеальное сочетание для приобретения недвижимости.</p>\\r\\n</div>\\r\\n</div>\\r\\n</div>\\r\\n<div class=\\\"flex justify-between empty:hidden gizmo:mt-1 gizmo:justify-start gizmo:gap-3 lg:block gizmo:lg:flex\\\">&nbsp;</div>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_433526708.jpg\", \"title\": \"Серик\", \"content\": \"<div class=\\\"flex flex-grow flex-col max-w-full gap-3 gizmo:gap-0\\\">\\r\\n<div class=\\\"min-h-[20px] text-message flex flex-col items-start gap-3 whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 overflow-x-auto\\\" data-message-author-role=\\\"assistant\\\" data-message-id=\\\"0d30e276-408c-4cc3-9e4c-b0380cb3af2d\\\">\\r\\n<div class=\\\"markdown prose w-full break-words dark:prose-invert light\\\">\\r\\n<p><strong>Serik &mdash; </strong>инвестируйте в роскошь на Средиземноморском побережье. История и современность тесно переплетаются в Serik. Пляжи, гольф-курорты, культурные события и современная инфраструктура делают этот регион Анталии идеальным для приобретения недвижимости. Вложитесь в уникальный образ жизни, где природа и роскошь встречаются на пороге вашего нового дома.</p>\\r\\n</div>\\r\\n</div>\\r\\n</div>\"}, {\"id\": \"2\", \"photo\": \"uploads/landing_875297687.jpg\", \"title\": \"Анталия\", \"content\": \"<p><strong>Анталия&nbsp;</strong> &mdash;&nbsp; инвестируйте в элитную недвижимость у моря. Современные апартаменты, роскошные виллы, исторические уголки &mdash; выбор многогранен. Стабильный рынок, современная инфраструктура и близость к аэропорту делают Анталию идеальным местом для инвестиций. Роскошь, стабильность и перспективы роста в одном регионе.</p>\"}, {\"id\": \"3\", \"photo\": \"uploads/landing_2084700953.jpg\", \"title\": \"Кемер\", \"content\": \"<p><strong>Кемер</strong> &mdash; инвестиции в райское убежище на побережье Анталии. Совершите шаг к раю с покупкой недвижимости в Кемере. Пляжи, горы, история и яхтенные марины &mdash; эти элементы создают уникальное объединение природы и роскоши, предлагая владельцам недвижимости невероятный опыт на берегу Средиземного моря.</p>\"}]',NULL,NULL,17,NULL),(13,'Miray_home','https://Miray_home.one-team.pro/',3,'2023-11-21 12:48:38','2023-11-21 15:25:34','8 800 700 55 55','ЖК  MIRAY HOME','<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 150%;\">Miray Home &ndash; ваш уголок роскоши в Авсалларе. Идеальное место для комфортного проживания или отдыха, обеспечивая возможность пассивного дохода.</p>','uploads/landing_1150544444.jpg','[{\"id\": \"0\", \"title\": \"20\", \"content\": \"Всего квартир в комплексе\"}, {\"id\": \"1\", \"title\": \"1 км\", \"content\": \"До моря\"}, {\"id\": \"2\", \"title\": \"22 км\", \"content\": \"До Алании\"}, {\"id\": \"3\", \"title\": \"36 м2\", \"content\": \"Бассейн\"}]','НОВОСТРОЙКИ В','ЖК  MIRAY HOME','Ваш уголок роскоши в оазисе природы и комфорта на побережье Авсаллара.','[{\"id\": \"0\", \"photo\": \"uploads/landing_880722769.jpg\", \"title\": \"Новый эргономичный комплекс\", \"content\": \"<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: .0001pt; text-align: justify; line-height: 150%;\\\">Жилой комплекс MIRAY HOME расположен в живописном районе Авсаллар, всего в 22 км от центра Алании. Рядом с лучшим пляжем региона Инжекум и сосновым лесом национального заповедника, обеспечивая уникальный микроклимат. Комплекс включает 20 апартаментов с планировками 1+1 и 2+1 (duplex). Расстояние до моря &ndash; 1000 м, предлагается бесплатный шаттл. Социальная инфраструктура в шаговой доступности: магазины, кафе, рестораны. Внутри комплекса - бассейн, фитнес, сауна, зона барбекю, детская площадка, озелененная территория, автопарковка, видеонаблюдение. Апартаменты сдаются с чистовой отделкой, санузлами и встроенной кухонной мебелью. Идеальное место для комфортного проживания или отдыха, обеспечивая возможность пассивного дохода.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_1914837024.jpg\", \"title\": \"Большая закрытая территория с бассейном\", \"content\": \"<p>бассейн 36 м2<br>детская площадка<br>зона барбекю<br>шаттл до моря, через<br>центр Авсаллар</p>\"}, {\"id\": \"2\", \"photo\": \"uploads/landing_1309506583.jpg\", \"title\": \"Интерьер\", \"content\": \"<p>Все апартаменты на момент сдачи имеют встроенную&nbsp;кухонную мебель, гранитную столешницу, плитку из&nbsp;керамогранита</p>\"}, {\"id\": \"3\", \"photo\": \"uploads/landing_1021960201.jpg\", \"title\": \"Инфраструктура комплекса\", \"content\": \"<p>тренажерный зал<br>сауна<br>зона отдыха<br>видеонаблюдение<br>смотритель комплекса</p>\"}]','[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>&nbsp;</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]','uploads/landing_1272798977.jpg',NULL,'<p>Комплекс MIRAYHOME, за счет эргономичности и идеального расположения, подходит как для проживания большой семьей так и для самостоятельного отдыха, а также для получения пассивного дохода.</p>\r\n<p>&nbsp;</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Aaac29a6cff6512185bc432090011ffc5a9cb224a2af25814386f35ed4ed1ee03&amp;source=constructor\" width=\"1063\" height=\"527\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ',NULL,'MIRAY INVEST','Alanya/Avsallar',25,NULL);
