  `living_size` double(8,2) DEFAULT NULL,
  `number_rooms` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `floor` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `number_bedrooms` int DEFAULT NULL,
  `number_bathrooms` int DEFAULT NULL,
  `number_balconies` int DEFAULT NULL,
  `complex_id` bigint unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `id_in_crm` bigint DEFAULT NULL,
  `layout_id_in_crm` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `layouts_id_in_crm_unique` (`id_in_crm`),
