ial shops, making it Antalya\'s largest residential project. While the green area of ​​24,712 m² offers a life adorned with the magnificent beauties of nature, it offers the opportunity to experience the fun of the city and the peace of nature at the same time as the social amenities within.','Project 1207 Antalya is located in Kepez district, in the heart of the city, just 9 km from Antalya International Airport, 5 km from the city center and 8 km from the beach, with excellent social amenities for everyone, offering easy access to everywhere.','2023-11-16 20:24:27','2023-11-16 20:24:27',NULL),(114,41,2,'Квартира 1+1 на 1 этаже  блока E, с мебелью и техникой,  В тапу 850000 лир Хамам, Сауна, Фитнес, Охрана 24/7,  С видом во двор, Новый дом в комплексе Ekpa 1207   Antalya, названный в честь года освобождения Анталии, построен на участке площадью 30 гектаров с 1163 квартирами и 46 коммерческими магазинами, что делает его крупнейшим жилым проектом Антальи. В то время как зеленая территория площадью 24 712 м² предлагает жизнь, украшенную великолепными красотами природы, она дает возможность ощутить веселье города и покой природы одновременно с социальными удобствами внутри.','Проект 1207 Antalya расположен в районе Кепез, в самом центре города, всего в 9 км от международного аэропорта Антальи, в 5 км от центра города и в 8 км от пляжа, с отличными социальными удобствами для всех, предлагая легкий доступ к повсюду.','2023-11-16 20:24:27','2023-11-16 20:24:27',NULL),(115,41,3,'E blok 1.kat, mobilya ve beyaz eşyalı 1+1 daire, Tapa 850.000 lira Hamam, Sauna, Fitness, 7/24 Güvenlik, Avluya bakan, Ekpa 1207 Antalya kompleksinde yeni ev, adını Antalya\'nın kurulduğu yıldan alıyor 30 hektarlık arazi üzerinde 1.163 daire ve 46 ticari mağazanın yer aldığı Kurtuluş, Antalya\'nın en büyük konut projesi olma özelliği taşıyor. 24.712 m²\'lik yeşil alan, doğanın muhteşem güzellikleriyle bezenmiş bir yaşam sunarken, içerisinde yer alan sosyal olanaklarla birlikte şehrin eğlencesini ve doğanın huzurunu aynı anda deneyimleme fırsatı sunuyor.','Proje 1207 Antalya, şehrin göbeğinde Kepez semtinde, Antalya Uluslararası Havalimanı\'na sadece 9 km, şehir merkezine 5 km ve plaja 8 km uzaklıkta, herkes için mükemmel sosyal olanaklara sahip, her yere kolay ulaşım imkanı sunan bir konumda yer almaktadır.','2023-11-16 20:24:27','2023-11-16 20:24:27',NULL),(116,41,4,'Apartment 1+1 im 1. Stock von Block E, mit Möbeln und Geräten, Tapa 850.000 Lira, Hammam, Sauna, Fitness, Sicherheit rund um die Uhr, Blick auf den Innenhof, neues Haus im Ekpa 1207 Antalya-Komplex, benannt nach dem Jahr von Antalya Liberation wurde auf einem 30 Hektar großen Grundstück mit 1.163 Wohnungen und 46 Gewerbegeschäften errichtet und ist damit Antalyas größtes Wohnprojekt. Während die Grünfläche von 24.712 m² ein mit den herrlichen Schönheiten der Natur geschmücktes Leben ermöglicht, bietet sie gleichzeitig die Möglichkeit, den Spaß der Stadt und die Ruhe der Natur zu erleben und gleichzeitig die sozialen Annehmlichkeiten zu genießen.','Das Projekt 1207 Antalya befindet sich im Stadtteil Kepez, im Herzen der Stadt, nur 9 km vom internationalen Flughafen Antalya, 5 km vom Stadtzentrum und 8 km vom Strand entfernt, mit hervorragenden sozialen Einrichtungen für alle und einfachem Zugang zu allen Orten.','2023-11-16 20:24:28','2023-11-16 20:24:28',NULL),(117,45,1,'The total number of apartments in the project is 50 sq.\r\nThe area of ​​the building plot is 2,850 m²,\r\nUnderground parking,\r\nSurface parking,\r\nOpen pool,\r\nA fitness center,\r\nSauna,\r\nBBQ areas,\r\nChildren playground,\r\nProtected area,\r\nfine finishing,\r\nWarm floor,\r\nBuilt-in kitchen furniture,\r\nStove, oven, hood,\r\nPlumbing,\r\nBuilt-in furniture in the hallway.','To the Airport – 10 minutes,\r\nTo the sea - 10 minutes,\r\nTo the TerraCity shopping center – 15 minutes,\r\n10 min to Mall of Antalya and IKEA','2023-11-16 20:24:28','2023-11-16 20:24:28',NULL),(118,45,2,'Общее кол-во квартир в проекте – 50 кв,