nd 0,5 km, Antalya Kaleici 18 km, Aspendos 35 km','2023-11-18 11:26:40','2023-11-18 11:26:40',NULL),(375,23,5,'Авсаллар - ідеальний район для тих, хто віддає перевагу тиші, спокою та гармонії з природою, адже з одного боку розташувався найкращий пляж регіону Інжекум - пляж з м\'яким піском (він так і перекладається «дрібний пісок») і пологім ідеальним для дітей. З іншого боку, сосновий ліс національного заповідника, за рахунок чого у районі створюється особливий мікроклімат.','Від міжнародного аеропорту Анталія – 92 км,\r\nВід аеропорту Газіпаша - 63 км,\r\nПоруч продуктові магазини, бари, ресторани,\r\nфермерський ринок,\r\nДо моря -1,5 км','2023-11-18 11:26:41','2023-11-18 11:26:41',NULL),(376,23,6,'آوسالار یک منطقه ایده آل برای کسانی است که صلح، آرامش و هماهنگی با طبیعت را ترجیح می دهند، زیرا در یک طرف بهترین ساحل در منطقه Incekum قرار دارد - ساحلی با نرم ترین شن ها (به عنوان \"شن های ریز\" ترجمه می شود) و ورودی ملایم. ایده آل برای کودکان از طرفی جنگل کاج یک ذخیره گاه ملی است که به دلیل آن ریزاقلیم خاصی در منطقه ایجاد می شود.','از فرودگاه بین المللی آنتالیا - 92 کیلومتر،\r\nاز فرودگاه Gazipasa - 63 کیلومتر،\r\nفروشگاه های مواد غذایی، کافه ها، رستوران ها،\r\nبازار کشاورزان،\r\nبه دریا -1.5 کیلومتر','2023-11-18 11:26:42','2023-11-18 11:26:42',NULL),(377,23,7,'تعتبر Avsallar منطقة مثالية لأولئك الذين يفضلون السلام والهدوء والانسجام مع الطبيعة، لأنه من جهة يوجد أفضل شاطئ في منطقة Incekum - شاطئ ذو رمال أنعم (يُترجم على أنه \"رمال ناعمة\") ومدخل لطيف مثالية للأطفال. من ناحية أخرى، تعد غابة الصنوبر محمية وطنية، حيث يتم إنشاء مناخ محلي خاص في المنطقة.','من مطار أنطاليا الدولي - 92 كم،\r\nمن مطار غازي باشا – 63 كم،\r\nمحلات البقالة القريبة والحانات والمطاعم،\r\nسوق المزارعين،\r\nإلى البحر -1.5 كم','2023-11-18 11:26:42','2023-11-18 11:26:42',NULL),(378,23,8,'Авсаллар макони беҳтаринест барои онҳое, ки сулҳ, оромӣ ва ҳамоҳангиро бо табиат афзалтар медонанд, зеро аз як тараф беҳтарин соҳил дар минтақаи Инчекум - соҳил бо реги нармтарин (он ҳамчун \"реги нозук\" тарҷума шудааст) ва даромадгоҳи мулоим аст. идеалӣ барои кӯдакон. Аз тарафи дигар, бешаи санавбар мамнуъгохи миллй буда, ба туфайли он дар район микроиклими махсус ба вучуд оварда мешавад.','Аз Фурудгоҳи Байналмилалии Анталия - 92 км,\r\nАз фурудгоҳи Ғазипаша - 63 км,\r\nДар наздикии мағозаҳои хӯрокворӣ, барҳо, тарабхонаҳо,\r\nбозори деҳқонӣ,\r\nБа баҳр - 1,5 км','2023-11-18 11:26:43','2023-11-18 11:26:43',NULL),(379,23,9,'Avsallar - tinchlik, osoyishtalik va tabiat bilan uyg\'unlikni afzal ko\'radiganlar uchun ideal hudud, chunki bir tomonda Incekum mintaqasidagi eng yaxshi plyaj - eng yumshoq qumli plyaj (u \"nozik qum\" deb tarjima qilinadi) va yumshoq kirish joyi. bolalar uchun ideal. Boshqa tomondan, qarag\'ay o\'rmoni milliy qo\'riqxona bo\'lib, u tufayli hududda maxsus mikroiqlim yaratilgan.','Antaliya xalqaro aeroportidan - 92 km,\r\nGazipasha aeroportidan - 63 km,\r\nYaqin atrofdagi oziq-ovqat do\'konlari, barlar, restoranlar,\r\ndehqon bozori,\r\nDengizgacha - 1,5 km','2023-11-18 11:26:43','2023-11-18 11:26:43',NULL),(380,23,10,'Авсаллар - бейбітшілікті, тыныштықты және табиғатпен үйлесімділікті қалайтындар үшін тамаша аймақ, өйткені бір жағында Инчеқұм аймағындағы ең жақсы жағажай - ең жұмсақ құмы бар жағажай («ұсақ құм» деп аударылады) және жұмсақ кіреберіс. балалар үшін тамаша. Екінші жағынан, қарағайлы орман ұлттық қорық болып табылады, соның арқасында ауданда ерекше микроклимат жасалған.','Анталия халықаралық әуежайынан - 92 км,\r\nГазипаса әуежайынан – 63 км,\r\nЖақын жерде азық-түлік дүкендері, барлар, мейрамханалар,\r\nфермерлер базары,\r\nТеңізге дейін -1,5 км','2023-11-18 11:26:44','2023-11-18 11:26:44',NULL),(381,23,11,'Avsallar est une zone idéale pour ceux qui préfèrent la paix, la tranquillité et l\'harmonie avec la nature, car d\'un côté se trouve la meilleure plage de la région d\'Incekum - une plage avec le sable le plus doux (cela se traduit par « sable fin ») et une entrée en douceur. idéal pour les enfants. D\'autre part, la forêt de pins est une réserve nationale, grâce à laquelle un microclimat particulier est créé dans la région.','De l\'aéroport international d\'Antalya - 92 km,\r\nDe l\'aéroport de Gazipasa – 63 km,\r\nÉpiceries, bars, restaurants à proximité,\r\nmarché des fermiers,\r\nÀ la mer -1,5 km','2023-11-18 11:26:44','2023-11-18 11:26:44',NULL),(382,23,12,'Avsallar är ett idealiskt område för dem som föredrar fred, lugn och harmoni med naturen, för på ena sidan finns den bästa stranden i Incekum-regionen - en strand med den mjukaste sanden (det översätts som \"fin sand\") och en mjuk ingång idealisk för barn. Å andra sidan är tallskogen ett nationellt reservat, på grund av vilket ett speciellt mikroklimat skapas i området.','Från Antalyas internationella flygplats - 92 km,\r\nFrån Gazipasas flygplats - 63 km,\r\nNärliggande livsmedelsbutiker, barer, restauranger,\r\nbondens marknad,\r\nTill havet -1,5 km','2023-11-18 11:26:45','2023-11-18 11:26:45',NULL),(383,23,13,'Avsallar er et ideelt område for de som foretrekker fred, ro og harmoni med naturen, fordi på den ene siden er den beste stranden i Incekum-regionen - en strand med den mykeste sanden (det er oversatt som \"fin sand\") og en mild inngang ideell for barn. På den annen side er furuskogen et nasjonalt reservat, på grunn av dette skapes et spesielt mikroklima i området.','Fra Antalya internasjonale lufthavn - 92 km,\r\nFra Gazipasa flyplass - 63 km,\r\nNærliggende dagligvarebutikker, barer, restauranter,\r\nbonde marked,\r\nTil sjøen -1,5 km','2023-11-18 11:26:45','2023-11-18 11:26:45',NULL),(384,23,14,'Avsallar is een ideaal gebied voor degenen die vrede, rust en harmonie met de natuur verkiezen, omdat aan de ene kant het beste strand in de regio Incekum ligt - een strand met het zachtste zand (het wordt vertaald als \"fijn zand\") en een zachte ingang ideaal voor kinderen. Aan de andere kant is het dennenbos een nationaal reservaat, waardoor er een speciaal microklimaat in het gebied ontstaat.','Vanaf de internationale luchthaven van A