 11:27:54',NULL),(526,36,13,'Villaen med 6+1 rom har 3 bad, 2 en-suite bad, vaskerom, badstue, tyrkisk bad og treningsstudio. Prosjektet, som ligger i Küçühasbahçe-distriktet, vil bli bygget på en tomt på 1.000 m2 av CNP MİMARLIK LTD. ŞTİ i blokk 1853, tomt. Prosjektet har en unik arkitektur med 4 etasjer. Åpent basseng,\r\nGarasje,\r\nGenerator,\r\nKlimaanlegg,\r\nHeis','Kjøpesenter 3 km,\r\nAvstand til sjøen 2 km','2023-11-18 11:27:54','2023-11-18 11:27:54',NULL),(527,36,14,'De 6+1 kamervilla heeft 3 badkamers, 2 en-suite badkamers, wasruimte, sauna, Turks bad en fitnessruimte. Het project, gelegen in de wijk Küçühasbahçe, zal worden gebouwd op een perceel van 1.000 m2 door CNP MİMARLIK LTD. ŞTİ in blok 1853, plot. Het project heeft een unieke architectuur met 4 verdiepingen. Open zwembad,\r\nGarage,\r\nGenerator,\r\nAirco,\r\nLift','Winkelcentrum 3 km,\r\nAfstand tot de zee 2 km','2023-11-18 11:27:54','2023-11-18 11:27:54',NULL),(528,36,15,'6+1 værelses villaen har 3 badeværelser, 2 en-suite badeværelser, vaskerum, sauna, tyrkisk bad og fitnesscenter. Projektet, der ligger i Küçühasbahçe-distriktet, vil blive bygget på en grund på 1.000 m2 af CNP MİMARLIK LTD. ŞTİ i blok 1853, grund. Projektet har en unik arkitektur med 4 etager. Åben pool,\r\nGarage,\r\nGenerator,\r\nKlimaanlæg,\r\nElevator','Indkøbscenter 3 km,\r\nAfstand til havet 2 km','2023-11-18 11:27:55','2023-11-18 11:27:55',NULL),(529,37,5,'Кожна спальня має балкон з видом на море та басейн з південного боку. Вітальня з каміном, 1 спальня з ванною кімнатою, 1 спільна ванна кімната, тамбур та шахта ліфта\r\nє. Головний фасад усіх наших номерів звернений у південному напрямку, але домінує фасад, звернений до басейну та моря.\r\nПроект нашої вілли має 3 зупинки, які можуть бути використані на всіх поверхах, починаючи з першого до поверху на даху.\r\nЛіфт, підлога з підігрівом на всіх поверхах та в кімнатах та центральна система кондиціювання.\r\nНа відкритій території нашого проекту вілли великий ландшафтний сад хобі сад відкритий нескінченний басейн\r\nБасейн площею 100 кв. м з шезлонгом, дитячим басейном та багатровим майданчиком. На ділянці також є\r\nавтоматичні ворота зі зручним доступом з дорожнього підйому, закрита автостоянка на 4 машини, майданчик для генератора, відкрита автостоянка на 3 машини\r\nЄ паркування та легкі підпірні стіни з камерами спостереження.','До моря 2 км','2023-11-18 11:27:55','2023-11-18 11:27:55',NULL),(530,37,6,'هر اتاق خواب دارای بالکن مشرف به دریا و استخر در سمت جنوبی است. اتاق نشیمن با شومینه، 1 اتاق خواب با حمام، 1 حمام مشترک، دهلیز و چاه آسانسور\r\nدر دسترس. نمای اصلی همه اتاق های ما به سمت جنوب است، اما نمای رو به استخر و دریا غالب است.\r\nپروژه ویلای ما دارای 3 ایستگاه است که در تمامی طبقات از طبقه همکف تا پشت بام قابل استفاده است.\r\nآسانسور، گرمایش از کف در تمامی طبقات و اتاق ها و تهویه مطبوع مرکزی.\r\nدر محوطه باز پروژه ویلای ما یک باغ سرگرمی محوطه سازی شده بزرگ با یک استخر بی نهایت روباز وجود دارد.\r\nمساحت استخر 100 متر مربع متر با یک صندلی آفتابگیر، یک استخر کودکان و یک گودال آتش. سایت نیز دارد\r\nدرب اتوماتیک با دسترسی آسان از بالابر جاده، پارکینگ بسته برای 4 خودرو، منطقه ژنراتور، پارکینگ در فضای باز برای 3 خودرو\r\nپارکینگ و دیوارهای حائل سبک با دوربین های امنیتی وجود دارد.','2 کیلومتر تا دریا','2023-11-18 11:27:56','2023-11-18 11:27:56',NULL),(531,37,7,'تحتوي كل غرفة نوم على شرفة مطلة على البحر والمسبح على الجانب الجنوبي. غرفة معيشة مع مدفأة، غرفة نوم واحدة مع حمام، حمام مشترك، دهليز وعمود مصعد\r\nمتاح. الواجهة الرئيسية لجميع غرفنا تواجه الجنوب، ولكن الواجهة التي تواجه حمام السباحة والبحر هي المهيمنة.\r\nيحتوي مشروع الفيلا الخاص بنا على 3 محطات يمكن استخدامها في جميع الطوابق، من الطابق الأرضي إلى طابق السطح.\r\nمصعد وتدفئة أرضية في جميع الطوابق والغرف وتكييف مركزي.\r\nيوجد في المنطقة المفتوحة لمشروع الفيلا الخاص بنا حديقة هواية كبيرة ذات مناظر طبيعية مع مسبح لا متناهي في الهواء الطلق\r\nمساحة حمام السباحة 100 متر مربع. م مع كرسي استلقاء للتشمس ومسبح للأطفال وحفرة نار. الموقع لديه أيضا\r\nبوابات أوتوماتيكية مع سهولة الوصول إليها من مصعد الطريق، موقف مغلق يتسع لـ 4 سيارات، منطقة مولدات، موقف خارجي يتسع لـ 3 سيارات\r\nيوجد موقف سيارات وجدران استنادية خفيفة الوزن مزودة بكاميرات أمنية.','2 كم إلى البحر','2023-11-18 11:27:57','2023-11-18 11:27:57',NULL),(532,37,8,'Ҳар як хонаи хоб дорои балконест, ки ба баҳр ва ҳавз дар тарафи ҷануб нигаронида шудааст. Хонаи истиқоматӣ бо оташдон, 1 хонаи хоб бо ҳаммом, 1 ҳаммоми муштарак, вестибул ва лифт\r\nдастрас. Фасади асосии ҳамаи утоқҳои мо ба ҷануб нигаронида шудааст, аммо фасади рӯ ба ҳавзу баҳр бартарӣ дорад.\r\nЛоиҳаи виллаи мо 3 истгоҳ дорад, ки онҳоро дар ҳама ошёнаҳо, аз ошёнаи якум то ошёнаи болои бом истифода бурдан мумкин аст.\r\nЛифт, гармидиҳии зеризаминӣ дар ҳама ошёнаҳо ва ҳуҷраҳо ва кондитсионери марказӣ.\r\nДар майдони кушоди лоиҳаи виллаи мо як боғи калони манзарадор бо ҳавзи беохири берунӣ мавҷуд аст\r\nМайдони ҳавзи шиноварӣ 100 кв. м бо путёвкаи офтобй, хавзи бачагона ва оташдон. Сайт инчунин дорад\r\nдарвозаҳои автоматӣ бо дастрасии осон аз лифт, таваққуфгоҳи пӯшида барои 4 мошин, майдони генератор, таваққуфгоҳи беруна барои 3 мошин\r\nТаваққуфгоҳ ва деворҳои сабук бо камераҳои амниятӣ мавҷуданд.','2 км ба баҳр','2023-11-18 11:27:57','2023-11-18 11:27:57',NULL),(533,37,9,'Har bir yotoqxonada janub tomonda dengiz va hovuzga qaraydigan balkon mavjud. Kaminli yashash xonasi, hammomli 1 yotoq xonasi, 1 umumiy hammom, vestibyul va lift shaftasi\r\nmavjud. Barcha xonalarimizning asosiy jabhasi janubga qaragan, ammo hovuz va dengizga qaragan jabhada ustunlik qiladi.\r\nBizning villa loyihamizda birinchi qavatdan to tomigacha bo\'lgan barcha qavatlarda foydalanish mumkin bo\'lgan 3 ta to\'xtash joyi mavjud.\r\nLift, barcha qavat va xonalarda yerdan isitish va markaziy konditsioner.\r\nVilla loyihamizning ochiq maydonida ochiq cheksizlik hovuzi bo\'lgan katta landshaftlangan sevimli mashg\'ulot bog\'i mavjud\r\nHovuz maydoni 100 kv. m quyoshli choyshab, bolalar hovuzi va o\'t o\'chog\'i bilan. Saytda ham bor\r\nyo\'l liftidan oson kirishga ega avtomatik eshiklar, 4 ta mashina uchun yopiq to\'xtash joyi, generator maydoni, 3 ta mashina uchun ochiq to\'xtash joyi\r\nTo\'xtash joyi va xavfsizlik kameralari bilan engil himoya devorlari mavjud.','dengizga 2 km','2023-11-18 11:27:57','2023-11-18 11:27:57',NULL),(534,37,10,'Әрбір жатын бөлмеде оңтүстік жағында теңізге және бассейнге қарайтын балкон бар. Камині бар қонақ бөлмесі, ванна бөлмесі бар 1 жатын бөлме, 1 ортақ ванна бөлмесі, вестибюль және лифт шахтасы\r\nқолжетімді. Біздің барлық бөлмелеріміздің негізгі қасбеті оңтүстікке қарайды, бірақ бассейн мен теңізге қарайтын қасбет басым.\r\nБіздің вилла жобамызда бірінші қабаттан шатырдың қабатына дейін барлық қабаттарда пайдалануға болатын 3 аялдама бар.\r\nЛифт, барлық қабаттар мен бөлмелерде еден жылыту және орталық кондиционер.\r\nБіздің вилла жобасының ашық аймағында ашық шексіздік бассейні бар үлкен ландшафты хобби бағы бар\r\nБассейннің ауданы 100 шаршы метр. м шезлонги, балалар бассейні және от жағу орны бар. Сайтта да бар\r\nлифттен оңай қол жетімді автоматты қақпалар, 4 көлікке арналған жабық тұрақ, генератор алаңы, 3 көлікке арналған ашық тұрақ\r\nАвтотұрақ және қауіпсіздік камералары бар жеңіл тірек қабырғалары бар.','Теңізге 2 км','2023-11-18 11:27:58','2023-11-18 11:27:58',NULL),(535,37,11,'Chaque chambre dispose d\'un balcon avec vue sur la mer et la piscine côté sud. Salon avec foyer, 1 chambre avec salle de bain, 1 salle de bain commune, vestibule et cage d\'ascenseur\r\ndisponible. La façade principale de toutes nos chambres est orientée plein sud, mais la façade face à la piscine et à la mer domine.\r\nNotre projet de villa comporte 3 arrêts pouvant être utilisés à tous les étages, du rez-de-chaussée au toit.\r\nAscenseur, chauffage au sol à tous les étages et pièces et climatisation centrale.\r\nDans la zone ouverte de notre projet de villa se trouve un grand jardin paysager avec une piscine extérieure à débordement.\r\nEspace piscine 100 m². m avec une chaise longue, une piscine pour enfants et un foyer. Le site dispose également\r\nportails automatiques avec accès facile depuis l\'ascenseur routier, parking fermé pour 4 voitures, zone générateur, parking extérieur pour 3 voitures\r\nIl y a un parking et des murs de soutènement légers avec caméras de sécurité.','2 km de la mer','2023-11-18 11:27:58','2023-11-18 11:27:58',NULL),(536,37,12,'Varje sovrum har en balkong med utsikt över havet och poolen på södra sidan. Vardagsrum med öppen spis, 1 sovrum med badrum, 1 delat badrum, vestibul och hisschakt\r\ntillgängliga. Huvudfasaden på alla våra rum vetter mot söder, men fasaden mot poolen och havet dominerar.\r\nVårt villaprojekt har 3 hållplatser som kan användas på alla våningar, från bottenvåningen till takvåningen.\r\nHiss, golvvärme på alla våningar och rum samt central luftkonditionering.\r\nI det öppna området av vårt villaprojekt finns en stor anlagd hobbyträdgård med en infinitypool utomhus\r\nPoolområde 100 kvm. m med en solstol, en barnpool och en eldstad. Sajten har också\r\nautomatiska grindar med enkel åtkomst från vägliften, stängd parkering för 4 bilar, generatorområde, utomhusparkering för 3 bilar\r\nDet finns parkering och lätta stödmurar med säkerhetskameror.','2 km till havet','2023-11-18 11:27:59','2023-11-18 11:27:59',NULL),(537,37,13,'Hvert soverom har en balkong med utsikt over havet og bassenget på sørsiden. Stue med peis, 1 soverom med bad, 1 felles bad, vestibyle og heissjakt\r\ntilgjengelig. Hovedfasaden på alle våre rom vender mot sør, men fasaden mot bassenget og havet dominerer.\r\nVårt villaprosjekt har 3 stopp som kan brukes i alle etasjer, fra første etasje til taketasjen.\r\nHeis, gulvvarme i alle etasjer og rom og sentralt klimaanlegg.\r\nI det åpne området til villaprosjektet vårt er det en stor anlagt hobbyhage med et utendørs evighetsbasseng\r\nSvømmebassengareal 100 kvm. m med en solseng, et barnebasseng og en bålplass. Siden har også\r\nautomatiske porter med enkel tilgang fra veiheisen, lukket parkering for 4 biler, generatorområde, utendørs parkering for 3 biler\r\nDet er parkering og lette støttemurer med sikkerhetskameraer.','2 km til sjøen','2023-11-18 11:27:59','2023-11-18 11:27:59',NULL),(538,37,14,'Elke slaapkamer heeft een balkon met uitzicht op de zee en het zwembad aan de zuidkant. Woonkamer met open haard, 1 slaapkamer met badkamer, 1 gedeelde badkamer, vestibule en liftschacht\r\nbeschikbaar. De hoofdgevel van al onze kamers ligt op het zuiden, maar de gevel met uitzicht op het zwembad en de zee domineert.\r\nOns villaproject heeft 3 haltes die op alle verdiepingen kunnen worden gebruikt, van de begane grond tot de dakverdieping.\r\nLift, vloerverwarming op alle verdiepingen en kamers en centrale airconditioning.\r\nIn de open ruimte van ons villaproject bevindt zich een grote aangelegde hobbytuin met een overloopzwembad in de buitenlucht\r\nZwembadoppervlak 100 m². m met een ligstoel, een kinderbad en een vuurplaats. De site heeft dat ook\r\nautomatische poorten met gemakkelijke toegang vanaf de weglift, afgesloten parkeerplaats voor 4 auto\'s, generatorruimte, buitenparkeerplaats voor 3 auto\'s\r\nEr is parkeergelegenheid en lichtgewicht keermuren met beveiligingscamera\'s.','2 km naar de zee','2023-11-18 11:28:00','2023-11-18 11:28:00',NULL),(539,37,15,'Hvert soveværelse har en balkon med udsigt over havet og poolen på sydsiden. Stue med pejs, 1 soveværelse med badeværelse, 1 fælles badeværelse, vestibule og elevatorskakt\r\nledig. Hovedfacaden på alle vores værelser vender mod syd, men facaden mod poolen og havet dominerer.\r\nVores villaprojekt har 3 stop, der kan bruges på alle etager, fra stueetagen til tagetagen.\r\nElevator, gulvvarme på alle etager og værelser og centralt klimaanlæg.\r\nI det åbne område af vores villaprojekt er der en stor anlagt hobbyhave med en udendørs infinity pool\r\nSwimmingpool areal 100 kvm. m med en liggestol, en børnepool og en bålplads. Siden har også\r\nautomatiske porte med nem adgang fra vejliften, lukket parkering til 4 biler, generatorområde, udendørs parkering til 3 biler\r\nDer er parkering og lette støttemure med sikkerhedskameraer.','2 km til havet','2023-11-18 11:28:00','2023-11-18 11:28:00',NULL),(540,38,5,'У комплексі багато відкритих просторів та озеленених доріжок,\r\nВідкритий басейн,\r\nКритий басейн,\r\nДитячий басейн, Аквапарк,\r\nТурецький хамам (лазня),\r\nСауна,\r\nПарова лазня,\r\nЗона відпочинку,\r\nГенератор,\r\nЛобі,\r\nДитячий майданчик,\r\nЗарезервована парковка на 20-25 авто','Неподалік від комплексу розташовані магазини роздрібної торгівлі, ресторани та кафе, численні турецькі лавки та інші соціально значущі об\'єкти, які необхідні для зручного життя. Завдяки цій чудовій локації жителі комплексу почуватимуться комфортно. 150 метрів від моря.','2023-11-18 11:28:01','2023-11-18 11:28:01',NULL),(541,38,6,'این مجموعه دارای فضاهای باز و مسیرهای محوطه سازی شده زیادی است.\r\nاستخر باز،\r\nاستخر سرپوشیده،\r\nاستخر کودکان، پارک آبی،\r\nحمام ترکی\r\nسونا،\r\nحمام بخار،\r\nمنطقه استراحت،\r\nژنراتور،\r\nلابی،\r\nزمین بازی،\r\nپارکینگ رزرو شده برای 20-25 ماشین','در مجاورت این مجموعه، فروشگاه‌های خرده‌فروشی، رستوران‌ها و کافه‌ها، مغازه‌های ترکی متعدد و دیگر اشیاء اجتماعی مهم وجود دارد که برای یک زندگی راحت ضروری هستند. به لطف این موقعیت عالی، ساکنان مجتمع احساس راحتی خواهند کرد. فاصله تا دریا 150 متر.','2023-11-18 11:28:01','2023-11-18 11:28:01',NULL),(542,38,7,'يحتوي المجمع على العديد من المساحات المفتوحة والممرات ذات المناظر الطبيعية،\r\nمسبح مفتوح,\r\nمسبح داخلي،\r\nحمام سباحة للأطفال، حديقة مائية،\r\nحمام تركي (حمام) ،\r\nساونا،\r\nحمام البخار،\r\nمنطقة الراحة,\r\nمولد كهرباء،\r\nردهة،\r\nملعب،\r\nموقف سيارات محجوز يتسع لـ 20-25 سيارة','يوجد في المنطقة المجاورة مباشرة للمجمع متاجر البيع بالتجزئة والمطاعم والمقاهي والعديد من المتاجر التركية وغيرها من الأشياء ذات الأهمية الاجتماعية الضرورية لحياة مريحة. بفضل هذا الموقع الرائع، سيشعر سكان المجمع بالراحة. 150 متر من البحر.','2023-11-18 11:28:02','2023-11-18 11:28:02',NULL),(543,38,8,'Маҷмаа дорои ҷойҳои зиёди