rc aquatique,\r\nhammam (bain) turc,\r\nSauna,\r\nBain de vapeur,\r\nAire de repos,\r\nGénérateur,\r\nHall d\'entrée,\r\nCour de récréation,\r\nParking réservé pour 20-25 voitures','Dans les environs immédiats du complexe se trouvent des magasins de détail, des restaurants et des cafés, de nombreux magasins turcs et d\'autres objets socialement importants nécessaires à une vie confortable. Grâce à cet emplacement magnifique, les résidents du complexe se sentiront à l\'aise. A 150 mètres de la mer.','2023-11-18 11:28:04','2023-11-18 11:28:04',NULL),(547,38,12,'Komplexet har många öppna ytor och anlagda stigar,\r\nöppen pool,\r\nInomhuspool,\r\nBarnpool, vattenpark,\r\nturkiskt hamam (bad),\r\nBastu,\r\nÅngbad,\r\nvilozon,\r\nGenerator,\r\nLobby,\r\nLekplats,\r\nReserverad parkering för 20-25 bilar','I omedelbar närhet av komplexet finns butiker, restauranger och kaféer, många turkiska butiker och andra socialt betydelsefulla föremål som är nödvändiga för ett bekvämt liv. Tack vare detta underbara läge kommer invånarna i komplexet att känna sig bekväma. 150 meter från havet.','2023-11-18 11:28:05','2023-11-18 11:28:05',NULL),(548,38,13,'Komplekset har mange åpne områder og anlagte stier,\r\nÅpent basseng,\r\nInnendørs basseng,\r\nBarnebasseng, badeland,\r\ntyrkisk hamam (bad),\r\nBadstue,\r\nDampbad,\r\nHvilesone,\r\nGenerator,\r\nLobby,\r\nLekeplass,\r\nReservert parkering for 20-25 biler','I umiddelbar nærhet av komplekset er det butikker, restauranter og kafeer, mange tyrkiske butikker og andre sosialt viktige gjenstander som er nødvendige for et komfortabelt liv. Takket være denne fantastiske beliggenheten vil beboerne i komplekset føle seg komfortable. 150 meter fra sjøen.','2023-11-18 11:28:05','2023-11-18 11:28:05',NULL),(549,38,14,'Het complex beschikt over veel open ruimtes en aangelegde paden,\r\nOpen zwembad,\r\nBinnenzwembad,\r\nKinderzwembad, Waterpark,\r\nTurkse hamam (bad),\r\nSauna,\r\nStoombad,\r\nRustzone,\r\nGenerator,\r\nLobby,\r\nSpeelplaats,\r\nGereserveerde parkeerplaats voor 20-25 auto\'s','In de directe omgeving van het complex bevinden zich winkels, restaurants en cafés, talrijke Turkse winkels en andere sociaal belangrijke objecten die nodig zijn voor een comfortabel leven. Dankzij deze prachtige ligging zullen de bewoners van het complex zich op hun gemak voelen. 150 meter van de zee.','2023-11-18 11:28:06','2023-11-18 11:28:06',NULL),(550,38,15,'Komplekset har mange åbne rum og anlagte stier,\r\nÅben pool,\r\nIndendørs pool,\r\nBørnepool, Vandland,\r\ntyrkisk hamam (bad),\r\nSauna,\r\nDampbad,\r\nHvilezone,\r\nGenerator,\r\nLobby,\r\nLegeplads,\r\nReserveret parkering til 20-25 biler','I umiddelbar nærhed af komplekset er der detailbutikker, restauranter og caféer, talrige tyrkiske butikker og andre socialt betydningsfulde genstande, der er nødvendige for et behageligt liv. Takket være denne vidunderlige beliggenhed vil beboerne i komplekset føle sig godt tilpas. 150 meter fra havet.','2023-11-18 11:28:06','2023-11-18 11:28:06',NULL),(551,39,5,'12-ти поверховий житловий комплекс преміум класу в районі Аланії Махмутлара. У будинку буде всього 77 квартир з якісною чистовою обробкою та звукоізоляцією. З вікон квартир відкривається шикарний краєвид на гори, а з квартир на верхніх поверхах - унікальний краєвид на Середземне море. Площа земельної ділянки складає 2380 м², що дозволяє розмістити максимальну кількість об\'єктів інфраструктури для комфортного відпочинку та постійного проживання.','Комплекс розташований на вулиці Ататюрк – одній із основних дорожніх артерій Махмутлара. У кроковій доступності кафе, магазини, ринок, дитячі парки, школи, дитячий садок, медичний центр.','2023-11-18 11:28:07','2023-11-18 11:28:07',NULL),(552,39,6,'یک مجتمع مسکونی 12 طبقه ممتاز در منطقه محمودلار آلانیا. این ساختمان تنها دارای 77 آپارتمان با کیفیت عالی و عایق صوتی خواهد بود. پنجره‌های آپارتمان‌ها منظره‌ای باشکوه از کوه‌ها را ارائه می‌دهند و از آپارتمان‌های طبقات بالا منظره‌ای بی‌نظیر از دریای مدیترانه را به نمایش می‌گذارند. مساحت زمین 2380 متر مربع است که به شما امکان می دهد حداکثر امکانات زیربنایی را برای تفریح ​​راحت و اقامت دائم در خود جای دهید.','این مجموعه در خیابان آتاتورک، یکی از شریان های اصلی جاده محمودلار واقع شده است. کافه‌ها، مغازه‌ها، بازار، پارک‌های کودکان، مدارس، مهدکودک و مرکز پزشکی در فاصله‌ای چند قدمی قرار دارند.','2023-11-18 11:28:07','2023-11-18 11:28:07',NULL),(553,39,7,'مجمع سكني متميز مكون من 12 طابقا في منطقة محمودلار في ألانيا. سيحتوي المبنى على 77 شقة فقط بتشطيبات عالية الجودة وعزل للصوت. توفر نوافذ الشقق إطلالة رائعة على الجبال، ومن الشقق في الطوابق العليا - إطلالة فريدة على البحر الأبيض المتوسط. تبلغ مساحة قطعة الأرض 2380 مترًا مربعًا، مما يسمح لك باستيعاب أكبر عدد ممكن من مرافق البنية التحتية للاستجمام المريح والإقامة الدائمة.','يقع المجمع على شارع أتاتورك، أحد شرايين الطريق الرئيسية في محمودلار. على مسافة قريبة توجد المقاهي والمحلات التجارية والسوق وحدائق الأطفال والمدارس وروضة الأطفال والمركز الطبي.','2023-11-18 11:28:08','2023-11-18 11:28:08',NULL),(554,39,8,'Маҷмааи истиқоматии 12-ошёнаи премиум дар минтақаи Маҳмутлар Алания. Бино хамагй 77 квартира дорад, ки бо ороиши аълосифат ва изолятсияи садо. Тирезаҳои квартираҳо манзараи бошукӯҳи кӯҳҳо ва аз квартираҳои ошёнаҳои боло манзараи беназири баҳри Миёназаминро пешкаш мекунанд. Масоҳати қитъаи замин 2380 м² мебошад, ки ба шумо имкон медиҳад, ки шумораи ҳадди аксар иншооти инфрасохторӣ барои фароғати бароҳат ва истиқомати доимӣ ҷойгир карда шаванд.','Маҷмаа дар кӯчаи Отатурк, яке аз шоҳроҳҳои асосии Маҳмутлар ҷойгир аст. Дар масофаи пиёда кахвахона, магазин, бозор, боги бачагон, мактаб, богчаи бачагон, пункти тиббй чойгиранд.','2023-11-18 11:28:08','2023-11-18 11:28:08',NULL),(555,39,9,'Alaniyaning Mahmutlar hududidagi 12 qavatli premium turar-joy majmuasi. Binoda yuqori sifatli pardozlash va ovoz izolatsiyasiga ega atigi 77 xonadon bo‘ladi. Kvartiralarning derazalaridan tog‘larning ajoyib manzarasi, yuqori qavatlardagi xonadonlardan esa O‘rta er dengizining noyob ko‘rinishi ochiladi. Er uchastkasining maydoni 2380 m² ni tashkil etadi, bu sizga qulay dam olish va doimiy yashash uchun maksimal miqdordagi infratuzilma ob\'ektlarini joylashtirish imkonini beradi.','Majmua Mahmutlar shahrining asosiy yo‘l arteriyalaridan biri bo‘lgan Otaturk ko‘chasida joylashgan. Piyoda masofada kafe, do\'konlar, bozor, bolalar bog\'chalari, maktablar, bolalar bog\'chasi, tibbiyot punkti joylashgan.','2023-11-18 11:28:09','2023-11-18 11:28:09',NULL),(556,39,10,'Аланияның Махмутлар ауданындағы 12 қабатты премиум тұрғын үй кешені. Ғимаратта әрлеу сапасы жоғары және дыбыс оқшаулауы бар 77 пәтер ғана болады. Пәтерлердің терезелері таулардың керемет көрінісін ұсынады, ал жоғарғы қабаттардағы пәтерлерден - Жерорта теңізінің бірегей көрінісі. Жер учаскесінің ауданы 2380 м² құрайды, бұл жайлы демалу және тұрақты тұру үшін инфрақұрылымдық нысандардың максималды санын орналастыруға мүмкіндік береді.','Кешен Махмуттардың негізгі жол артерияларының бірі Ататүрік көшесінде орналасқан. Жаяу қашықтықта кафелер, дүкендер, базар, балалар саябағы, мектеп, балабақша, медициналық пункт бар.','2023-11-18 11:28:09','2023-11-18 11:28:09',NULL),(557,39,11,'Un complexe résidentiel haut de gamme de 12 étages dans le quartier Mahmutlar d\'Alanya. Le bâtiment ne comptera que 77 appartements avec des finitions et une isolation phonique de haute qualité. Les fenêtres des appartements offrent une vue magnifique sur les montagnes, et depuis les appartements des étages supérieurs, une vue unique sur la mer Méditerranée. La superficie du terrain est de 2380 m², ce qui permet d\'accueillir le maximum d\'infrastructures pour des loisirs confortables et une résidence permanente.','Le complexe est situé dans la rue Ataturk, l\'une des principales artères routières de Mahmutlar. À distance de marche se trouvent des cafés, des magasins, un marché, des parcs pour enfants, des écoles, un jardin d\'enfants et un centre médical.','2023-11-18 11:28:10','2023-11-18 11:28:10',NULL),(558,39,12,'Ett premiumbostadskomplex med 1