площею 24 712 м² пропонує життя, прикрашене чудовою красою природи, воно дає можливість відчути веселість міста та спокій природи одночасно із соціальними зручностями всередині.','Проект 1207 Antalya розташований в районі Кепез, в самому центрі міста, всього за 9 км від міжнародного аеропорту Анталії, за 5 км від центру міста і за 8 км від пляжу, з відмінними соціальними зручностями для всіх, пропонуючи легкий доступ до всюди.','2023-11-18 11:28:19','2023-11-18 11:28:19',NULL),(574,41,6,'آپارتمان 1+1 طبقه 1 بلوک E با مبلمان و لوازم تاپا 850000 لیر همام سونا تناسب اندام نگهبانی 24 ساعته مشرف به حیاط خانه نوساز در مجتمع اکپا 1207 آنتالیا به نام سال آنتالیا لیبراسیون، در زمینی به مساحت 30 هکتار با 1163 آپارتمان و 46 مغازه تجاری ساخته شده است که آن را به بزرگترین پروژه مسکونی آنتالیا تبدیل کرده است. در حالی که مساحت سرسبز 24712 متر مربع، زندگی آراسته به زیبایی های باشکوه طبیعت را ارائه می دهد، فرصتی را برای تجربه لذت شهر و آرامش طبیعت همزمان با امکانات رفاهی اجتماعی در داخل فراهم می کند.','پروژه 1207 آنتالیا در منطقه کپز، در قلب شهر، تنها 9 کیلومتر از فرودگاه بین المللی آنتالیا، 5 کیلومتر از مرکز شهر و 8 کیلومتر با ساحل، با امکانات اجتماعی عالی برای همه، دسترسی آسان به همه جا، واقع شده است.','2023-11-18 11:28:20','2023-11-18 11:28:20',NULL),(575,41,7,'شقة 1+1 في الطابق الأول من المبنى E، مع الأثاث والأجهزة، تابا 850.000 ليرة حمام، ساونا، لياقة بدنية، أمن 24/7، مطلة على الفناء، منزل جديد في مجمع Ekpa 1207 أنطاليا، سمي على اسم عام أنطاليا التحرير، تم بناؤه على موقع مساحته 30 هكتارًا ويضم 1163 شقة و46 محلًا تجاريًا، مما يجعله أكبر مشروع سكني في أنطاليا. بينما توفر المساحة الخضراء البالغة 24.712 مترًا مربعًا حياة تتزين بجمال الطبيعة الرائع، فهي توفر الفرصة لتجربة متعة المدينة وهدوء الطبيعة في نفس الوقت مع المرافق الاجتماعية بداخلها.','يقع مشروع 1207 أنطاليا في منطقة كيبيز، في قلب المدينة، على بعد 9 كم فقط من مطار أنطاليا الدولي، و 5 كم من وسط المدينة و 8 كم من الشاطئ، مع مرافق اجتماعية ممتازة للجميع، مما يوفر سهولة الوصول إلى كل مكان.','2023-11-18 11:28:20','2023-11-18 11:28:20',NULL),(576,41,8,'Квартира 1+1 дар ошёнаи 1 блоки Е, бо мебел ва асбобу анҷом, Тапа 850,000 лира Ҳаммом, Сауна, Фитнес, Амният 24/7, Манзараи ҳавлӣ, Хонаи нав дар маҷмааи Экпа 1207 Анталия, ба номи соли Анталия Liberation, ки дар майдони 30 гектар бо 1163 квартира ва 46 мағозаи тиҷоратӣ сохта шудааст, ки онро бузургтарин лоиҳаи истиқоматии Анталия табдил медиҳад. Дар ҳоле ки майдони сабзи 24,712 м² ҳаёти бо зебоиҳои зебои табиат ороёфтаро пешкаш мекунад, он имкон медиҳад, ки ҳамзамон бо шароити иҷтимоӣ дар дохили шаҳр лаззат баред ва оромии табиатро эҳсос кунед.','Project 1207 Antalya дар ноҳияи Кепес, дар маркази шаҳр, ҳамагӣ 9 км аз фурудгоҳи байналмилалии Анталия, 5 км аз маркази шаҳр ва 8 км аз соҳил ҷойгир буда, дорои шароити хуби иҷтимоӣ барои ҳама ва дастрасии осон ба ҳама ҷо мебошад.','2023-11-18 11:28:21','2023-11-18 11:28:21',NULL),(577,41,9,'E blokining 1-qavatida 1+1 kvartira, mebel va jihozlar bilan, Tapa 850 000 lira Hammom, Sauna, Fitnes, 24/7, Hovliga qaragan, Antaliya nomidagi Ekpa 1207 Antaliya majmuasida yangi uy. 1163 xonadon va 46 savdo do\'koni bilan 30 gektar maydonda qurilgan ozodlik, Antaliyaning eng yirik turar-joy loyihasidir. Yashil maydon 24,712 m² tabiatning ajoyib go\'zalliklari bilan bezatilgan hayotni taklif qilsa-da, shaharning zavqlanishi va tabiatning tinchligi bilan bir vaqtda ijtimoiy qulayliklarni his qilish imkoniyatini taqdim etadi.','Project 1207 Antaliya shaharning qoq markazida, Kepez tumanida, Antaliya xalqaro aeroportidan atigi 9 km, shahar markazidan 5 km va plyajdan 8 km uzoqlikda joylashgan bo\'lib, hamma uchun ajoyib ijtimoiy qulayliklarga ega bo\'lib, hamma joyga oson kirish imkonini beradi.','2023-11-18 11:28:21','2023-11-18 11:28:21',NULL),(578,41,10,'Пәтер 1+1 Е блогының 1-қабатында жиһаз және техникасы бар, Тапа 850 000 лира Хаммам, сауна, фитнес, күзет 24/7, аулаға қарайтын, Ekpa 1207 Анталия кешеніндегі жаңа үй, Анталия жылының атымен аталған. Liberation, 1163 пәтер және 46 сауда дүкені бар 30 гектар аумақта салынған, бұл оны Анталияның ең үлкен тұрғын үй жобасы етеді. 24 712 м² жасыл аумақ табиғаттың керемет сұлулығымен безендірілген өмірді ұсынса да, қаланың қызықтарын және табиғаттың тыныштығын бір уақытта әлеуметтік ыңғайлылықпен сезінуге мүмкіндік береді.','Project 1207 Antalya Кепез ауданында, қаланың қақ ортасында, Анталия халықаралық әуежайынан небәрі 9 км, қала орталығынан 5 км және жағажайдан 8 км қашықтықта орналасқан, барлығына тамаша әлеуметтік жағдайлары бар және кез келген жерге оңай қол жетімділікті ұсынады.','2023-11-18 11:28:22','2023-11-18 11:28:22',NULL),(579,41,11,'Appartement 1+1 au 1er étage du bloc E, avec meubles et électroménagers, Tapa 850 000 lires Hammam, Sauna, Fitness, Sécurité 24h/24 et 7j/7, Donnant sur la cour, Maison neuve dans le complexe Ekpa 1207 Antalya, du nom de l\'année d\'Antalya libération, construit sur un terrain de 30 hectares avec 1 163 appartements et 46 commerces, ce qui en fait le plus grand projet résidentiel d\'Antalya. Alors que l\'espace vert de 24 712 m² offre une vie ornée des magnifiques beautés de la nature, il offre la possibilité de vivre le plaisir de la ville et le calme de la nature en même temps que les commodités sociales qui s\'y trouvent.','Le projet 1207 Antalya est situé dans le quartier de Kepez, au cœur de la ville, à seulement 9 km de l\'aéroport international d\'Antalya, à 5 km du centre-ville et à 8 km de la plage, avec d\'excellents équipements sociaux pour tous, offrant un accès facile partout.','2023-11-18 11:28:22','2023-11-18 11:28:22',NULL),(580,41,12,'Lägenhet 1+1 på 1:a våningen i block E, med möbler och vitvaror, Tapa 850 000 liras hamam, bastu, fitness, säkerhet 24/7, med utsikt över innergården, Nytt hus i Ekpa 1207 Antalya-komplexet, uppkallat efter Antalyas år liberation, byggt på en 30 hektar stor tomt med 1 163 lägenheter och 46 kommersiella butiker, vilket gör det till Antalyas största bostadsprojekt. Medan det gröna området på 24 712 m² erbjuder ett liv utsmyckat av naturens storslagna skönheter, ger det möjlighet att uppleva det roliga i staden och lugnet i naturen samtidigt som de sociala bekvämligheterna inom.','Project 1207 Antalya ligger i Kepez-distriktet, i hjärtat av staden, bara 9 km från Antalyas internationella flygplats, 5 km från stadens centrum och 8 km från stranden, med utmärkta sociala bekvämligheter för alla, vilket ger enkel tillgång till överallt.','2023-11-18 11:28:23','2023-11-18 11:28:23',NULL),(581,41,13,'Leilighet 1+1 i 1. etasje i blokk E, med møbler og hvitevarer, Tapa 850 000 liras Hammam, Sauna, Fitness, Sikkerhet 24/7, Med utsikt over gårdsplassen, Nytt hus i Ekpa 1207 Antalya-komplekset, oppkalt etter Antalyas år liberation, bygget på en 30 hektar stor tomt med 1163 leiligheter og 46 kommersielle butikker, noe som gjør det til Antalyas største boligprosjekt. Mens grøntområdet på 24 712 m² byr på et liv utsmykket med naturens storslåtte skjønnhet, gir det muligheten til å oppleve byens moro og naturens fred samtidig med de sosiale fasilitetene der inne.','Project 1207 Antalya ligger i Kepez-distriktet, i hjertet av byen, kun 9 km fra Antalya internasjonale lufthavn, 5 km fra sentrum og 8 km fra stranden, med utmerkede sosiale fasiliteter for alle, som gir enkel tilgang til overalt.','2023-11-18 11:28:24','2023-11-18 11:28:24',NULL),(582,41,14,'Appartement 1+1 op de 1e verdieping van blok E, met meubels en apparaten, Tapa 850.000 lira Hammam, sauna, fitness, beveiliging 24/7, uitzicht op de binnenplaats, nieuw huis in het Ekpa 1207 Antalya-complex, genoemd naar het jaar van Antalya bevrijding, gebouwd op een terrein van 30 hectare met 1.163 appartementen en 46 commerciële winkels, waardoor het het grootste woonproject van Antalya is. Terwijl het groene gebied van 24.712 m² een leven biedt dat is versierd met de prachtige schoonheden van de natuur, biedt het de mogelijkheid om het plezier van de stad en de rust van de natuur te ervaren en tegelijkertijd de sociale voorzieningen daarbinnen.','Project 1207 Antalya ligt in de wijk Kepez, in het hart van de stad, op slechts 9 km van de internationale luchthaven van Antalya, 5 km van het stadscentrum en 8 km van het strand, met uitstekende sociale voorzieningen voor iedereen en gemakkelijke toegang tot overal.','2023-11-18 11:28:24','2023-11-18 11:28:24',NULL),(583,41,15,'Lejlighed 1+1 på 1. sal i blok E, med møbler og hvidevarer, Tapa 850.000 liras Hammam, Sauna, Fitness, Sikkerhed 24/7, Udsigt over gården, Nyt hus i Ekpa 1207 Antalya komplekset, opkaldt efter Antalyas år befrielse, bygget på en 30 hektar stor grund med 1.163 lejligheder og 46 kommercielle butikker, hvilket gør det til Antalyas største boligprojekt. Mens det grønne område på 24.712 m² byder på et liv udsmykket med naturens storslåede skønheder, giver det mulighed for at opleve det sjove i byen og naturens fred på samme tid med de sociale faciliteter indeni.','Project 1207 Antalya er beliggende i Kepez-distriktet i hjertet af byen, kun 9 km fra Antalyas internationale lufthavn, 5 km fra byens centrum og 8 km fra stranden, med fremragende sociale faciliteter for alle, der giver nem adgang til overalt.','2023-11-18 11:28:24','2023-11-18 11:28:24',NULL),(584,45,5,'Загальна кількість квартир у проекті – 50 кв,\r\nПлоща ділянки під забудову – 2850 м²,\r\nПідземна парковка,\r\nНаземне паркування,\r\nВідкритий басейн,\r\nФітнес центр,\r\nСауна,\r\nЗони барбекю,\r\nДитячий ігровий майданчик,\r\nтериторія, що охороняється,\r\nЧистове оздоблення,\r\nТепла підлога,\r\nВбудовані кухонні меблі,\r\nПлита, духова шафа, витяжка,\r\nСантехніка,\r\nВбудовані меблі у передпокої.','До Аеропорту – 10 хв,\r\nДо моря – 10 хв,\r\nДо ТЦ TerraCity - 15 хв,\r\nДо ТЦ Mall of Antalya та IKEA – 10 хв','2023-11-18 11:28:25','2023-11-18 11:28:25',NULL),(585,45,6,'تعداد کل آپارتمان های این پروژه 50 متر مربع است.\r\nمساحت زمین 2850 متر مربع است.\r\nپارکینگ زیر زمینی،\r\nپارکینگ سطحی،\r\nاستخر باز،\r\nیک مرکز تناسب اندام،\r\nسونا،\r\nمناطق باربیکیو،\r\nزمین بازی بچه ها،\r\nمنطقه حفاظت شده،\r\